import React, { Component } from "react";
import { View } from "react-native";

export default function App() {
  return (
    <View>
      <Button title="Go back" onPress={() => navigation.goBack()} />
      <ul>
        <li>Level 1</li>
        <li>Level 2</li>
        <li>Level 3</li>
      </ul>
    </View>
  );
}
